	add("ninepence", "{\"term\":\"ninepence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|nine|pence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A former British silver coin, worth nine old old pennies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Hudibras\u0027, by Samuel Butler, part 1, s:Hudibras/Part 1/Canto canto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His wits were sent him for a token, But in the carriage crack\u0027d and broken. Like commendation \u0027\u0027nine-pence\u0027\u0027, crookt With—to and from my love—it lookt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nine old pennies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A Spanish real, valued at twelve and a half cents\", \"priority\":5}]}, \"synonyms\":{}}");

	add("ninesome", "{\"term\":\"ninesome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|nine|some|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of nine persons or things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, \u0027The Folk Dancer\u0027, volumes 1–3, [http://books.google.com/books?id\u003df5_WAAAAMAAJ\u0026amp;q\u003d%22ninesome%22\u0026amp;dq\u003d%22ninesome%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfpL0U5PPGZTMsQTYtYKADg\u0026amp;ved\u003d0CDUQ6AEwBA page 34\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the \u0027\u0027ninesome\u0027\u0027 reel the dance is fully organized; i.e. there is no arbitrary change of partner, and quite sophisticated dance-figures occur\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, October 13, \u0027LIFE\u0027 [http://books.google.com/books?id\u003dcj8EAAAAMBAJ\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22ninesome%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfpL0U5PPGZTMsQTYtYKADg\u0026amp;ved\u003d0CD0Q6AEwB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ninesome%22\u0026amp;f\u003dfalse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As they stood before a staid cast-iron gate across the street from where they work, they made as toothsome a \u0027\u0027ninesome\u0027\u0027 as could ever be glimpsed anywhere\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Stephen Clarkson, \u0027Does North America Exist?: Governing the Continent After NAFTA and 9/11\u0027, [http://books.google.com/books?id\u003dXlt25vCYqswC\u0026amp;pg\u003dPA441\u0026amp;dq\u003d%22ninesome%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfpL0U5PPGZTMsQTYtYKADg\u0026amp;ved\u003d0CFMQ6AEwC\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ninesome%22\u0026amp;f\u003dfalse page 441\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"On that day, representatives from each country\u0027s business community presented their fifty-one detailed recommendations to an impressive trinational \u0027\u0027ninesome\", \"priority\":9}]}, \"synonyms\":{}}");

	add("nineveh", "{\"term\":\"nineveh\", \"etymology\":{\"influencers\":[], \"languages\":[\"akkadian\", \"old english (ca. 450-1100)\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|Niniue}} under influence from Hebrew {{m|he|נִינְוֶה|tr\u003dNīnewēh}}, from Latin {{m|la|Ninive}}, from Ancient greek (to 1453) {{m|grc|Νινευή}}, ultimately from Akkadian {{m|akk|tr\u003dNinua}} or Old Babylonian {{m|akk|tr\u003dNinuwā}} of uncertain origin.\u0026lt;ref name\u003doed\u0026gt;\u0027Oxford English Dictionary\u0027, 3rd ed. \u0026quot;Ninevite, \u0027n.\u0027 and \u0027adj.\u0027\u0026quot; Oxford University Press (Oxford), 2013.\u0026lt;/ref\u0026gt; The cuneiform seems to denote \u0026quot;House of Fish\u0026quot;, although whether this referred to literal fish, an aspect of Ishtar, a separate Hurrian goddess, or something else entirely is unclear.\u0026lt;ref name\u003djenc\u0026gt;\u0026quot;[https://www.jewishvirtuallibrary.org/jsource/judaica/ejud_0002_0015_0_14857.html Nineveh]\u0026quot; in the \u0027Encyclopaedia Judaica\u0027.\u0026lt;/ref\u0026gt;The traditional folk etymology in classical antiquity derived it from an eponymous founder Ninus (Greek: {{m|grc|Νίνος}}).\u0026lt;ref name\u003doed/\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ancient capital of Assyria\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ninja", "{\"term\":\"ninja\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"From Japanese {{m|ja|忍者|tr\u003dninja}}, with an underlying sense of {{m|en|secret}} or {{m|en|hidden}} {{m|en|person}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person trained primarily in stealth, espionage, assassination and the Japanese martial art of ninjutsu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Mongolian amateurish private miner (mainly for gold); after the shape of the plastic bowls used to wash metal ore with mercury, roughly resembling one of the \u0027w:Teenage Mutant Ninja Teenage Mutant Ninja Turtles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 October 10, Jonathan Watts, \u0026quot;Prospectors and \u0027ninja\u0027 miners flood to east\u0027s El Dorado\u0026quot; [http://www.guardian.co.uk/world/2007/oct/10/international.mainsection1], \u0027The Guardian\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Many were former nomads, but as the gold rush gathered pace, students, vets and taxi drivers from Ulan Bator joined the \u0027\u0027ninjas\u0027\u0027, not just in Ogoomor but in other gold towns across the country\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Juggalo version of the epithet \u0026quot;nigga\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What up, my \u0027\u0027ninja\", \"priority\":6}]}, \"synonyms\":{}}");

