	add("ninjutsu", "{\"term\":\"ninjutsu\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\", \"late middle chinese\"], \"text\":\"From Japanese \u0027忍術\u0027 (tr\u003dninjutsu \u0026lt;/i\u0026gt;にんじゅつ\u0026lt;i\u0026gt;) from Late middle chinese 忍 (\u0027nyín\u0027 \u0026quot;to forbear\u0026quot;) + 術 (\u0027ʑwit\u0027 \u0026quot;technique\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Japanese martial art that is a collection of techniques originally practiced for Japanese espionage purposes, and includes methods of gathering information, nondetection, avoidance, and misdirection techniques. Used by ninja (忍者\", \"priority\":1}]}, \"synonyms\":{}}");

